def generate_polygonal_numbers(polygon, limit):
    numbers = []
    n = 1
    while True:
        if polygon == "triangle":
            number = n * (n + 1) // 2
        elif polygon == "square":
            number = n ** 2
        elif polygon == "pentagonal":
            number = n * (3 * n - 1) // 2
        elif polygon == "hexagonal":
            number = n * (2 * n - 1)
        elif polygon == "heptagonal":
            number = n * (5 * n - 3) // 2
        elif polygon == "octagonal":
            number = n * (3 * n - 2)
        else:
            raise ValueError("Invalid polygon type")

        if number >= limit:
            break

        if number >= 1000:
            numbers.append(number)

        n += 1

    return numbers


