def is_reversible(n):
    # Check if a number is reversible
    if n % 10 == 0:
        return False

    reverse = int(str(n)[::-1])
    sum_digits = n + reverse

    while sum_digits > 0:
        if sum_digits % 2 == 0:
            return False
        sum_digits //= 10

    return True

