def calculate_transitions():
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def digital_root(n):
        while n >= 10:
            n = sum(int(digit) for digit in str(n))
        return n

    def get_transitions(n):
        transitions = 0
        while n >= 10:
            transitions += 1
            n = digital_root(n)
        return transitions

    sam_transitions = 0
    max_transitions = 0

    for num in range(107, 2 * 10**7 + 1):
        if is_prime(num):
            sam_transitions += get_transitions(num)
            max_transitions += len(str(num)) - 1

    difference = sam_transitions - max_transitions
    return difference

