def euler_totient(n):
    result = n
    p = 2
    while p * p <= n:
        if n % p == 0:
            while n % p == 0:
                n //= p
            result -= result // p
        p += 1
    if n > 1:
        result -= result // n
    return result

def is_hamming_number(n):
    prime_factors = [2, 3, 5]
    for factor in prime_factors:
        while n % factor == 0:
            n //= factor
    return n == 1

def S(L):
    sum_n = 0
    for n in range(1, L+1):
        phi_n = euler_totient(n)
        if is_hamming_number(phi_n):
            sum_n += n
    return sum_n % (2**32)

