def Turans_water_heating_system(N):
    def T(N, m):
        if m == 0:
            return 0
        if m == 1:
            return N - 1
        if m == 2:
            return (N - 1) * (N - 2) // 2

        dp = [[0] * (m + 1) for _ in range(N + 1)]
        for i in range(N + 1):
            dp[i][1] = i - 1

        for i in range(2, N + 1):
            for j in range(2, m + 1):
                dp[i][j] = dp[i - 1][j] + dp[i - 1][j - 1] + 1

        return dp[N][m]

    L = 0
    for i in range(2, N + 1):
        L += T(N, i)

    return L

