def count_binary_matrices(n):
    memo = {}

    def count_matrices(n, rows, cols):
        if n == 0:
            return 1
        if (rows, cols) in memo:
            return memo[(rows, cols)]

        count = 0
        for i in range(2**rows):
            for j in range(2**cols):
                if bin(i).count('1') == rows and bin(j).count('1') == cols:
