    mobius = [1] * (n + 1)

    for p in range(2, n + 1):
        if is_prime[p]:
            primes.append(p)
            mobius[p] = -1

        for prime in primes:
            if p * prime > n:
                break
            is_prime[p * prime] = False

            if p % prime == 0:
                mobius[p * prime] = 0
                break
            else:
                mobius[p * prime] = -mobius[p]

    return mobius

