def convert_to_base14(number):
    base14_number = ""

    while number > 0:
        remainder = number % 14
        base14_number = str(remainder) + base14_number
        number = number // 14

    return int(base14_number)


def calculate_digit_sum(number):
    digit_sum = 0

    while number > 0:
        digit_sum += number % 10
        number = number // 10

