def find_last_9_digits():
    MOD = 10**9 + 7

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    def calculate_M(a, b, c):
        lcm = (a * b) // gcd(a, b)
        lcm = (lcm * c) // gcd(lcm, c)
        m = 6 // lcm
        return m

    def calculate_S(N):
        S = 0
        for a in range(1, N + 1):
            for b in range(1, N + 1):
                for c in range(1, N + 1):
                    M = calculate_M(a, b, c)
                    S = (S + M) % MOD
        return S

    N = 1234567890123
    S = calculate_S(N)
    return S % (10**9)

