def weak_queens(n):
    if n == 1:
        return 1
    if n == 2:
        return 2
    if n == 3:
        return 3
    if n == 4:
        return 5

    dp = [[0 for _ in range(n)] for _ in range(n)]

    dp[0][0] = 1
    dp[1][0] = 1
    dp[1][1] = 1
    dp[2][0] = 2
    dp[2][1] = 3
    dp[2][2] = 2

    for i in range(3, n):
        dp[i][0] = dp[i-1][0] + dp[i-2][0]
        dp[i][i] = dp[i-1][i-1] + dp[i-2][i-2]

        for j in range(1, i):
            dp[i][j] = dp[i-1][j-1] + dp[i-2][j] + dp[i-2][j-1] + dp[i-1][j] + dp[i-1][j+1]

    return sum(dp[n-1])

