import math

def radical(n):
    """Calculates the radical of a number."""
    rad = 1
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            rad *= i
            while n % i == 0:
                n //= i
    if n > 1:
        rad *= n
    return rad

def E(n):
    """Finds the E(n) value."""
    radicals = [(i, radical(i)) for i in range(1, n+1)]
    radicals.sort(key=lambda x: x[1])
    return radicals[n-1][0]

