def find_palindromic_numbers():
    palindromic_numbers = []
    for i in range(2, 1000):
        count = 0
        for j in range(2, int(i ** 0.5) + 1):
            if i % j == 0:
                count += 1
                if count > 4:
                    break
        if count == 4:
            palindromic_numbers.append(i)
        if len(palindromic_numbers) == 5:
            break
    return palindromic_numbers

