def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True


def digit_difference(a, b):
    count = 0
    for i in range(len(str(a))):
        if str(a)[i] != str(b)[i]:
            count += 1
    return count


def is_relative(a, b):
    if a == b:
        return False
    if digit_difference(a, b) == 1:
        return True
    if len(str(b)) == len(str(a)) + 1 and b // 10 == a:
        return True
    return False


def find_primes_not_relative(n):
    prime_sum = 0
    for i in range(2, n + 1):
        if is_prime(i):
            is_relative_prime = False
            for j in range(2, i):
                if is_prime(j) and is_relative(j, i):
                    is_relative_prime = True
                    break
            if not is_relative_prime:
                prime_sum += i
    return prime_sum

