def euler_totient(n):
    result = n
    p = 2
    while p * p <= n:
        if n % p == 0:
            while n % p == 0:
                n //= p
            result -= result // p
        p += 1
    if n > 1:
        result -= result // n
    return result

def g(n):
    factors = [2]
    remaining = n // 2
    while remaining % 2 == 0:
        factors.append(2)
        remaining //= 2

    p = 3
    while p * p <= remaining:
        if remaining % p == 0:
            factors.append(p)
            remaining //= p
            while remaining % p == 0:
                remaining //= p
        p += 2

    if remaining > 1:
        factors.append(remaining)

    result = 0
    for factor in factors:
        result += euler_totient(n // factor)

    return result

