def calculate_inversion_count(N):
    primes = []
    for num in range(2, N):
        if all(num % i != 0 for i in range(2, int(num ** 0.5) + 1)):
            primes.append(num)

    F = 0
    for prime in primes:
        F += (N // prime) * (N // prime - 1) // 2

