def D(n, m):
    primes = set()
    primes.add(2)
    for i in range(3, int(max(n, m)**0.5) + 1, 2):
        if n % i == 0 or m % i == 0:
            primes.add(i)
    if n % 2 == 0 or m % 2 == 0:
        primes.add(2)

    result = 0
    for prime in primes:
        result += abs(nu_p(n, prime) - nu_p(m, prime))
    return result

