    if len(sequence) == 1:
        return sequence[0]
    else:
        partial_sum_sequence = []
        for i in range(1, len(sequence)):
            partial_sum_sequence.append(sequence[i] + partial_sum_sequence[i-1])
        return partial_sum_sequence[-1]

