def flip_cake_icing(n):
    def F(a, b, c):
        flips = 0
        while True:
            if a == b == c:
                return flips
            max_degree = max(a, b, c)
            if max_degree == a:
                a -= b + c
            elif max_degree == b:
                b -= a + c
            else:
                c -= a + b
            flips += 1

    def G(n):
        summation = 0
        for a in range(1, n+1):
            for b in range(a+1, n+1):
                for c in range(b+1, n+1):
                    summation += F(a, b, c)
        return summation

    return G(n)

