def count_connected_graphs(n):
    if n < 2:
        return 0
    elif n == 2:
        return 1
    elif n == 3:
        return 2

    # Initialize counts for different degrees
    counts = [0] * (n + 1)
    counts[2] = 1
    counts[3] = 2

    # Calculate counts for higher degrees
    for i in range(4, n + 1):
        counts[i] = (counts[i - 1] + counts[i - 2]) % 1000000007

