def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def euler_totient(n):
    result = n
    i = 2
    while i * i <= n:
        if n % i == 0:
            while n % i == 0:
                n //= i
            result -= result // i
        i += 1
    if n > 1:
        result -= result // n
    return result

def coresilience_sum(limit):
    composite_numbers = []
    for n in range(2, limit + 1):
        if not is_prime(n):
            phi = euler_totient(n)
            coresilience = n - phi / (n - 1)
            if coresilience == 1 / n:
                composite_numbers.append(n)
    return sum(composite_numbers)

