        return 2
    elif N == 2:
        return 30
    else:
        # Initialize the count to 0
        count = 0

        # Iterate over all possible cut points
        for x in range(1, N):
            for y in range(1, N):
                # Check if the cut point is on a different side of the square
                if x != y:
                    # Check if the cut point has integer coordinates
                    if x % 1 == 0 and y % 1 == 0:
