def find_path(a, b):
    if a == b:
        return [a]
    elif a[0] > b[0] or a[1] > b[1]:
        return None
    elif (b[0] - a[0]) % 2 == 0 and (b[1] - a[1]) % 2 == 0:
        return None

    path1 = find_path(r(a[0], a[1]), b)
    path2 = find_path(s(a[0], a[1]), b)

    if not path1 and not path2:
        return None
    elif not path1:
        return [a] + path2
    elif not path2:
        return [a] + path1
    else:
        return [a] + path1 if len(path1) % 2 == 1 else [a] + path2

