def P(a, b):
    if a == b:
        return 1
    if is_prime(a) and is_prime(b):
        return 2
    if is_prime(a):
        return P(a, b - 1) + 1
    if is_prime(b):
        return P(a - 1, b) + 1
    return P(a - 1, b) + P(a, b - 1) - P(a - 1, b - 1)

