def circle_packing(n):
    total_area = 0
    count = 0

    for a in range(1, n+1):
        for b in range(a, n+1):
            if a + b > n:
                break
            for c in range(b, n+1):
                if a + b + c > n:
                    break
                count += 1
                max_radius = min(a, b, c) / 2
                area = 3.14159 * max_radius**2
                total_area += area

