def bounded_divisors(n, a, b):
    def liouville_function(n):
        exponents = []
        i = 2
        while i * i <= n:
            count = 0
            while n % i == 0:
                n //= i
                count += 1
            if count % 2 == 1:
                return -1
            exponents.append(count)
            i += 1
        if n > 1:
            exponents.append(1)
        return 1 if sum(exponents) % 2 == 0 else -1

    def divisor_sum(n):
        result = 0
        i = 1
        while i * i <= n:
            if n % i == 0:
                result += i
                if i != n // i:
                    result += n // i
            i += 1
        return result

    result = 0
    for i in range(a, b+1):
        liouville_val = liouville_function(i)
        if liouville_val == 1:
            result += divisor_sum(n) % 1000000007
        else:
            result -= divisor_sum(n) % 1000000007
    return result % 1000000007

result = bounded_divisors(70, 1020, 1060)
print(result)

