def count_tiling_ways(n):
    if n == 0:
        return 1
    elif n == 1:
        return 1
    else:
        ways = [0] * (n + 1)
        ways[0] = 1
        ways[1] = 1

        for i in range(2, n + 1):
            ways[i] = ways[i - 1] + ways[i - 2]

        return ways[n]

def longest_substring(s):
    n = len(s)
    count = [0] * 256
    for i in range(n):
        count[ord(s[i])] += 1

    result = 0
    for i in range(256):
        if count[i] > 1:
            curr_len = 0
            for j in range(n):
                if ord(s[j]) == i:
                    curr_len += 1
                else:
                    curr_len = 0
                result = max(result, curr_len)

    return result

def calculate_sum():
    S = "01010101010101010101010101010101010101010101010101"
    sum = 0
    for k in range(1, 5000001):
        L = longest_substring(S)
        if L != 0:
            sum += L
        S += "010101010101"

    return sum

