def solve_fermat():
    # function to check if a number is prime
    def is_prime(n):
        if n <= 1:
            return False
        if n <= 3:
            return True
        if n % 2 == 0 or n % 3 == 0:
            return False
        i = 5
        while i * i <= n:
            if n % i == 0 or n % (i + 2) == 0:
                return False
            i += 6
        return True

    # function to calculate F(p) for a prime number p
    def calculate_fermat(p):
        count = 0
        for a in range(1, p):
            for b in range(1, p):
                if (a ** 3 + b ** 3) % p == 0:
                    count += 1
        return count

    # main code
    sum_fermat = 0
    for p in range(2, 6000000):
        if is_prime(p):
            sum_fermat += calculate_fermat(p)

    return sum_fermat

result = solve_fermat()
print(result)

def diophantine_equation(n):
    result = 0
    for a in range(1, n+1):
        b = n - a
        result += (a * b) % (10**9)
    return result % (10**9)

# Example usage:
