def gcd(a, b):
    while b != 0:
        a, b = b, a % b
    return a

def H(N):
    count = 0
    for a in range(1, N+1):
        for b in range(1, N+1):
            if gcd(a, b) == 1 and a + b <= N:
                count += 1
    return count

